import './containerData.css'

function ContainerData({data}){

    const temp = data.main
    console.log(data)

    return(

        <div className='containerData'>

            <div className='date'>

                <span>Ola</span>

            </div>

            <div className='date'>

                <span>Temperatura</span>
                <span>{data.name}</span>
              

            </div>

            <div className='date'>

                <span>Ola</span>

            </div>

            
          

        </div>

    );

}

export default ContainerData;
